using Autofac;
using EnigmaLibrary;
using EnigmaLibrary.Decoding;
using NUnit.Framework;

namespace TestsEnigmaLibrary.Tests.DecodingTests
{
    [TestFixture]
    public class DecodingProcessorTests
    {
        [Test]
        [TestCase("AAAAAAAAAAAAAAAAAAAAA", "BDZGOWCXLTKSBTMCDLPBM")]
        [TestCase("AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA", "BDZGOWCXLTKSBTMCDLPBMUQOFXYHCXTGYJFLINHNXSHIUNTHE")]
        [TestCase("AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA",
            "BDZGOWCXLTKSBTMCDLPBMUQOFXYHCXTGYJFLINHNXSHIUNTHEORXPQPKOVHCBUBTZSZSOOSTGOTFSODBBZZLXLCYZXIFGWFDZEEQIBMGFJBW")]
        [TestCase("",
            "")]
        [TestCase("AAAAAAAAAA", "BDZGOWCXLT")]
        [TestCase("",
            "")]
        [TestCase("TAJNAWIADOMOSC", "ODDSOAPXRSTHJO")]
        [TestCase("ODDSOAPXRSTHJO", "TAJNAWIADOMOSC")]
        [TestCase("SUPERTAJNAWIADOMOSC", "JVSWERCCVTCXBFNZZNV")]
        [TestCase("JVSWERCCVTCXBFNZZNV", "SUPERTAJNAWIADOMOSC")]
        [TestCase("",
            "")]
        [TestCase("",
            "")]
        public void Decode_WhenCalled_ReturnsDecodedMessage(string message, string expected)
        {
            var container = Container.Configure();
            using (var scope = container.BeginLifetimeScope())
            {
                var sut = scope.Resolve<IDecodingProcessor>();
                var actual = sut.Decode(message);
                Assert.That(actual, Is.EqualTo(expected));
            }
        }
    }
}